import First from "./first";
import Full from "./full";
import Image from "./image";
import Info from "./info";
import Navbar from "./navbar";
import Rating from "./rating";

function Main(){
    return(
        <div>
            <Navbar></Navbar>
            <First></First>
            <Rating></Rating>
            <Info></Info>
            <Full></Full>
            <div className="image-collection">
                <Image></Image>
                <Image></Image>
                <Image></Image>
            </div>
        </div>
    )
}
export default Main;
